onst [start, setStart] = useState(false); // \u5012\u8ba1\u65f6\u6309\u94ae\u72b6\u6001\n\n  const { run, loading } = useAsync(asyncSendVerificationCode, { autoRun: false });\n\n  const triggerChange = changeValue => {\n    onChange({ ...value, ...changeValue });\n  };\n\n  const onCodeBlur = () => {\n    form.validateFields(["code", "validateCode"]);\n  }\n\n  const onCodeChange = e => {\n    triggerChange({ validateCode: e.target.value });\n  };\n\n  const onButtonClick = () => {\n    // \u6821\u9a8c\u624b\u673a\u53f7\u7801\n    form.validateFields([mobileField]).then((values) => {\n      return run({ mobile: values[mobileField] }).then(res => {\n        triggerChange({ requestId: res.data.requestId });\n        setStart(true);\n        inputRef.current.focus();\n      });\n    });\n  };\n\n  const handleEnd = useCallback(() => {\n    setStart(false);\n  }, []);\n\n  return (\n    <Row gutter={8}>\n      <Col span={16}>\n        <Input\n          placeholder="\u8bf7\u8f93\u5165\u9a8c\u8bc1\u7801"\n          onChange={onCodeChange}\n          onBlur={onCodeBlur}\n          value={value.validateCode}\n          maxLength={6}\n          allowClear\n          ref={inputRef}\n        />\n      </Col>\n      <Col span={8}>\n        <CountDownButton\n          start={start}\n          onClick={onButtonClick}\n          onEnd={handleEnd}\n          block\n          loading={loading}\n        />\n      </Col>\n    </Row>\n  );\n}\n\n// \u521d\u59cb\u503c\nconst initialValues = {\n  mobile: "",\n  code: {\n    requestId: "",\n    validateCode: ""\n  }\n}\n\n// \u89c4\u6574\u5316\u53c2\u6570\nconst normalizeValues = ({ mobile, code: { validateCode, requestId } }) => {\n  return {\n    mobile,\n    validateCode,\n    requestId\n  }\n}\n\nconst formItemLayout = {\n  labelCol: { span: 5 },\n  wrapperCol: { span: 16 }\n};\nconst buttonItemLayout = {\n  wrapperCol: { sm: { offset: 5 }, span: 16 }\n};\n\nexport default () => {\n  const [form] = Form.useForm();\n  const [params, setParams] = useState(() => normalizeValues(initialValues));\n\n  const onFinish = useCallback(values => {\n    setParams(normalizeValues(values));\n  }, []);\n\n  return (\n    <>\n      <Form\n        {...formItemLayout}\n        onFinish={onFinish}\n        form={form}\n        initialValues={initialValues}\n      >\n        <Form.Item\n          label="\u624b\u673a\u53f7\u7801"\n          name="mobile"\n          validateFirst\n          validateTrigger="onBlur"\n          required\n          rules={[\n            {\n              validator: (rule, value) => {\n                let errMsg = "";\n\n                if (!value) {\n                  errMsg = "\u8bf7\u8f93\u5165\u624b\u673a\u53f7\u7801";\n                } else if (!isMobile(value)) {\n                  errMsg = "\u8bf7\u8f93\u5165\u6b63\u786e\u7684\u624b\u673a\u53f7\u7801";\n                }\n\n                if (errMsg) {\n                  return Promise.reject(errMsg);\n                }\n\n                return Promise.resolve();\n              }\n            }\n          ]}\n        >\n          <Input placeholder="\u8bf7\u8f93\u5165\u624b\u673a\u53f7\u7801" allowClear />\n        </Form.Item>\n        <Form.Item\n          name="code"\n          label="\u9a8c\u8bc1\u7801"\n          validateFirst\n          validateTrigger="onBlur"\n          required\n          rules={[\n            {\n              validator(rule, value) {\n                let errMsg = "";\n                if (!value.requestId) {\n                  errMsg = "\u8bf7\u70b9\u51fb\u83b7\u53d6\u9a8c\u8bc1\u7801\u5e76\u8f93\u5165";\n                } else if (!value.validateCode) {\n                  errMsg = "\u8bf7\u8f93\u5165\u9a8c\u8bc1\u7801";\n                }\n                if (errMsg) {\n                  return Promise.reject(errMsg);\n                }\n\n                return Promise.resolve();\n              }\n            }\n          ]}\n        >\n          <VerificateCodeInput form={form} />\n        </Form.Ite